import './SignIn.css';
import React,{useState} from "react";
import logo from './img/blue_logo.PNG';
import signInText from './img/signIn.PNG';
import cat1 from './img/SignIn1.png';
import cat2 from './img/SignIn2.PNG';
import cat3 from './img/SignIn3.PNG';
import cat4 from './img/SignIn4.PNG';
import { BrowserRouter as Router,Link } from 'react-router-dom';//BrowserRouter
import { Routes ,Route } from 'react-router-dom';
import HomePage from './homePage.js';

class SignIn extends React.Component {
    constructor(props) {
      super(props);
      
      // 初始化輸入框的 state 值為空
      this.state = {value: '123'};
  
      this.handleChange = this.handleChange.bind(this);
      this.handleSubmit = this.handleSubmit.bind(this);
    }
  
    // onChange 事件處理函示
    handleChange(event) {
      // event.target 是當前的 DOM elment
      // 從 event.target.value 取得 user 剛輸入的值
      // 將 user 輸入的值更新回 state
      this.setState({value: event.target.value});
    }
  
    // form onSubmit 事件處理函式
    handleSubmit(event) {
      alert('Submit ' + this.state.value);
      event.preventDefault();
    }
  
    render() {
      // 將 value 設定為 this.state.value
      // 並監聽 onChange 來更新 state
      return (
        <div className="SignIn">    
            <div className='bg'>
                <div className='signIn'>
                    <div className="title">
                        
                        <div className="title-img">
                            <img src={logo} alt="IUA" />
                        </div>
                        <div className="title-text">
                            <img src={signInText} alt="IUA" />
                        </div>
                    </div>
                    <br/>
                    <form className="submitForm" onSubmit={this.handleSubmit}>
                        <label>學號:</label><br/>
                        <input type="text" name="student_id" 
                        value={this.state.value} onChange={this.handleChange} />
                        <br/>
                        <label>密碼:</label><br/>
                        <input type="password" name="password" />
                        <br/>
                        <br/>
                        <Link to='/homePage'>
                            <button type="submit" className="submitButton" >
                                <span className="button_text">登入</span>
                            </button>
                        </Link>
                    </form>
                    
                </div>
                    <div className="img1">
                        <img src={cat1} alt="IUA" />
                    </div>
                    <div className="img2">
                        <img src={cat2} alt="IUA" />
                    </div>
                    <div className="img3">
                        <img src={cat3} alt="IUA" />
                    </div>
                    <div className="img4">
                        <img src={cat4} alt="IUA" />
                    </div>

            </div>
            
        </div>
      );
    }
    
  }
  
  

